using Kitchen;
using KitchenData;
using KitchenLib.Customs;
using KitchenLib.References;
using KitchenLib.Utils;
using System;
using UnityEngine;

namespace KitchenLib.Systems
{
	public class AprilFoolsSystem : GameSystemBase
	{
		protected override void Initialise()
		{
			if (FeatureFlags.AprilFools && DateTime.Now.Month == 4 && DateTime.Now.Day == 1)
			{
				Main.instance.AddMaterial(JSONManager.LoadJsonMaterial<CFlatImage>(cage));
				Main.instance.AddMaterial(JSONManager.LoadJsonMaterial<CFlatImage>(danny));
				MaterialUtils.ApplyMaterial(GameData.Main.Prefabs[ApplianceReferences.FloorProtector], "AffordableFloorMat/Mat", new Material[] { MaterialUtils.GetCustomMaterial("Cage") });
				MaterialUtils.ApplyMaterial(GameData.Main.Prefabs[ApplianceReferences.Countertop], "Counter2/Counter Surface", new Material[] { MaterialUtils.GetCustomMaterial("Danny") });
			}
		}
		protected override void OnUpdate() { }

		private string cage = "{\r\n  \"_ImageAsBase64\": \"\",\r\n  \"Type\": 7,\r\n  \"_Alpha\": 1.0,\r\n  \"_BlowoutScale1\": 1.0,\r\n  \"_BlowoutOffset1\": 0.0,\r\n  \"_IsBlowout\": 0.0,\r\n  \"Name\": \"Cage\"\r\n}";
		private string danny = "{\r\n  \"_ImageAsBase64\": \"\",\r\n  \"Type\": 7,\r\n  \"_Alpha\": 1.0,\r\n  \"_BlowoutScale1\": 1.0,\r\n  \"_BlowoutOffset1\": 0.0,\r\n  \"_IsBlowout\": 0.0,\r\n  \"Name\": \"Danny\"\r\n}";
	}
}
